import React from 'react';

function EmailView({ email }) {
  return (
    <div className="email-view">
      <h3>{email.subject}</h3>
      <p><strong>From:</strong> {email.from}</p>
      <p>{email.body}</p>
    </div>
  );
}

export default EmailView;
